    function sumYear() {
        const newYear = year + 1;
        setYear(newYear);
    }

    return (
        <section className="OurStory">

            <div className="text-story">
                <h1>Nossa <span>hist√≥ria</span></h1>
            </div>

            <h2 className="years">{year}</h2>

            <div className="sliderStory">
                <Carousel onClickItem={sumYear}>
                    <div>
                        texto 1
                    </div>

                    <div>
                        texto 2
                    </div>

                    <div>
                        texto 3
                    </div>

                    <div>
                        texto 4
                    </div>
                </Carousel>
            </div>
        </section>
    )
}
